import React from 'react';
import Button from '@mui/material/Button';
import Avatar from '@mui/material/Avatar'

function handleEventsDiscovery() { }

function HomePage() {
    return (
        <main style={{ padding: '0 20px', backgroundColor: '#f2f2f2', minHeight: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
            <div style={{ textAlign: 'center', color: '#333', fontFamily: 'Montserrat, sans-serif' }}>
                <Avatar

                    style={{
                        justifyContent: 'center',
                        height: '150px',
                        width: '150px'
                    }}>
                    H
                </Avatar>
                <h1 style={{ fontWeight: 'bold' }}>Welcome to the Home Page! NAME HERE</h1>

                <h2>You have successfully logged in!</h2>
                <p>Feel free to enjoy the following fun features!</p>
                <br />


                <Button
                    variant='outlined'
                    style={{
                        fontSize: '1.7rem',
                        borderRadius: '50px',
                        fontFamily: 'Montserrat, sans-serif',
                        color: '#9C27B0',
                        borderColor: '#9C27B0'
                    }}
                    onClick={handleEventsDiscovery}
                >

                    Events Discovery
                </Button>
            </div>
        </main>
    );
}

export default HomePage;
